import supernovas from '../images/supernovas.png';
import '../styles/Roadmap.css';

function Roadmap() {
  return (

    <div className="Roadmap">
      <header className="Roadmap-header">
        <p className="Peque ">There you can find aliens, zombies, robots and girls of different galaxies. This voyage has a futuristic orientation, that aims to subdue different ways of integrating art, community and technology in the fabulous NFT world.</p>
        <img src={supernovas} className="center imgborder" alt="Rats" style={{maxWidth: "1000px"}}/>
      </header><br/><br/><br/>
    </div>
  );
}

export default Roadmap;
